style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("faz.net")
{


/* Stile zum Entfernen von Logos, Bildern, SocialNetworking-Funktionen, Leserkommentaren etc. */

.LinkMehr { color: #FFFFFF !important; visibility:hidden !important }
#FooterLogo { visibility:hidden !important}
#EventBox { visibility:hidden !important}
.FAZArtikelFunktionen { visibility:hidden !important}
.ArtikelAbbinder { visibility:hidden !important}
.ServicesFooter { visibility:hidden !important}
#FAZContentRight { visibility:hidden !important}
#LMTicker { visibility:hidden !important}
.rechtehinweis { visibility:hidden !important}
.RelatedLinkArrow { visibility:hidden !important}


/* Stile für Seitenhintergrund */

body {background: #000000 !important; color: #b7b7b7 !important;}
div { background-color: #000000 !important; }
#RessortNav { background: #000000 !important;}


/* Stile für Links */

a:link { color: #ae844c !important; } /* Normale Links */
a:visited { color: #826339 !important; } /* Besuchte Links */
a:hover, a:active , a:visited:hover { color:  #B9D56E  !important;} /* Wenn die Maus über Links gehalten wird */ 

.Headline.LinkMehr{color: #b7b7b7 !important; visibility:visible !important; background: #000000 !important;}

/* Stile für Texte */

p { color: #8e8e8e !important; }
H1 { color: #b7b7b7 !important; }
H2 { color: #b7b7b7 !important; }
.Bildunterschrift { color: #8e8e8e !important; }
.Rubrikenkopf { color: #b7b7b7 !important; }
.Headline { color: #b7b7b7 !important; }
.Ressortkennung { color: #b7b7b7 !important; }
.Stichwort { color: #8e8e8e !important; }
.TeaserText { color: #8e8e8e !important; }
.Editors { color: #8e8e8e !important; }
.FAZArtikelText { color: #ccc !important; }
.FAZArtikelReiter {background: #000000 !important;}
.ArtikelHintergrundContent ul li { color: #8e8e8e !important; }

/* Stile für Menüs zur Rubrikenauswahl */

#nav li li.serviceLink { background: #000000 !important; }
#nav li ul li a:hover{background:#555555 !important;}
#AreaNav ul li:hover, #nav li ul, #nav li ul li, .Selected{background: #333333 !important;}
#nav li{border-left:1px solid #333333 !important; border-right:1px solid #333333 !important;}


/* Stile für Linien zwischen den Artikelteasern */

.Teaser300{border-top:solid 1px #333333 !important;}


/* FAZ-Logo mit invertierten Farben anzeigen */
/* Sehr langer Absatz, da das invertierte Logo als Base64-Code hier enthalten ist */

#logoHome {
	width: 0 !important;
	height: 0 !important;
	/* these numbers match the new image's dimensions */
	padding-left: 400px !important;
	padding-top: 70px !important;
	background: url("data:image/gif;base64,") no-repeat !important;
}

}
